import React from "react";
import classes from './contextMenu.module.css';

import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import * as Icon from 'react-feather'

const ContextMenu = props => {

    return (
        <div
            className={classes.myContextMenu}
            style={{left: `${props.left}px`, top: `${props.top}px`}}
        >
            <List component="nav" aria-label="secondary mailbox folders">
                <ListItem button onClick={() => alert('Add')}>
                    <Icon.Plus size={18} className="success mr-1"/>
                    <ListItemText primary="Add" />
                </ListItem>
                <ListItem button onClick={() => alert('Edit')}>
                    <Icon.Edit size={18} className="warning"/>
                    <ListItemText primary="Edit" />
                </ListItem>
                <ListItem button onClick={() => alert('Delete')}>
                    <Icon.Trash size={18} className="danger"/>
                    <ListItemText primary="Delete" />
                </ListItem>

            </List>
        </div>
    )
}

export default ContextMenu
